class Solution:
    def shortestPalindrome(self, s):
        """
        :type s: str
        :rtype: str
        """
        midx = int(len(s)/2)
        l, r = midx, midx
        shortest = []
        while l>=0 and r<len(s) and s[l] == s[r]: l, r = l-1,r+1
        if l < 0:
            candidate = ''.join(reversed(s[r:]))+s
            shortest = shortest if len(shortest) <= len(candidate) else candidate
        # if r == len(s):
        #     candidate = s+''.join(reversed(s[:l+1]))
        #     shortest = shortest if len(shortest) <= len(candidate) else candidate
